features.script:
upto = 3

count = 0;
secretkey = 0;

(async function() {
    console.log('hi'); 
    let h = await fetch(`https://martinmetaverse.io/csl/startGame.php`); 
    secretkey  = await h.text() 
    parcel.getFeatureById('coin').set({'link': "https://martinmetaverse.io/csl/?token="+secretkey})
})();

trigger =  parcel.getFeatureById('trigger')

trigger.set({'proximityToTrigger': 1.2})

trigger .on('trigger', e => { 
  console.log('running')
  console.log(trigger)
  count += 1
  console.log(count, upto)

  box =  parcel.getFeatureById('box')
  let r0 = box.createAnimation('position')
  r0.setKeys( [ 
    { frame: 0, value: box.position.add( new Vector3(0,0,0)  ) },
    { frame: 10, value: box.position.add( new Vector3(0,1,0) ) },
    { frame: 40, value: box.position.add( new Vector3(0,0,0) ) }
  ] )
  box.startAnimations( [r0] )

  console.log(r0)

  audio =  parcel.getFeatureById('audio')
  audio.play()
  msg()
  if( count == upto){ 
    fn();
  }
} )  

let msg = (()=>{
    let instructions = parcel.getFeatureById('instructions')
    let txt = ''
    if( count == 0 ){ txt = '## 請到禮物盒下，\n## 按 [電腦 - Space Bar空白鍵] 跳起拿取禮物，\n## 或 [手機 - Fly鍵 + 向上望 + 來回向前飛]' }
    else if( count < upto ){ txt = '## 跳多幾下就攞到喇' } 
    else{ txt = '## 請點擊金幣，\n## 通往禮品登記頁面' } 
    instructions.set({text:txt})
} )

let fn = (()=>{
  console.log('success!')
  let coin= parcel.getFeatureById('coin') 

  let r1 = coin.createAnimation('rotation')
  r1.setKeys([{ frame: 0, value: coin.rotation.add(new Vector3(0, 0, 0) ) }, { frame: 45, value: coin.rotation.add(new Vector3(0, 2*Math.PI, 0) ) }])

  let r2 = coin.createAnimation('position')
  r2.setKeys( [ 
    { frame: 0, value: coin.position.add( new Vector3(0,0,0)  ) },
    { frame: 200, value: coin.position.add( new Vector3(0,-7.5,0) ) }
  ] )
  coin.startAnimations( [r2] )

  let question = parcel.getFeatureById('question') 
  parcel.removeFeature(question)

  setInterval(function(){   
    coin.startAnimations( [r1] ) 
  }, 1500);



})
